import{_ as r,a as s,J as t,o as n}from"./chunks/framework.BWf-PbcG.js";const p="/assets/PROVODKA_12.BP70sXud.jpg",e="/assets/PROVODKA_24.Qfe94qzF.jpg",a="/assets/PROVODKA_04.DMZDk8UC.jpg",g="/assets/PROVODKA_05.B23afAjx.jpg",i="/assets/PROVODKA_11.Cu8QzvJ6.jpg",c="/assets/Proworking_plan-3-copy-2.DGRb1jcS.jpg",P=JSON.parse('{"title":"Проворкинг «PROVODKA»","description":"","frontmatter":{"title":"Проворкинг «PROVODKA»","date":"2015-11-23","icon":"logo.jpg","cover":"cover.jpg","address":"ул. Самокатная, 4с45","place":"Кристалл","city":"г. Москва","tel":"+7 (495) 361-34-11","email":"provodka@proworking.pro","url":"https://proworking.pro","coord":[55.75652808811811,37.67743905417032],"status":"closed"},"headers":[],"relativePath":"workshop/archive/provorking-provodka/index.md","filePath":"workshop/archive/provorking-provodka/index.md"}'),d={name:"workshop/archive/provorking-provodka/index.md"};function l(_,o,m,k,O,v){return n(),s("div",null,o[0]||(o[0]=[t('<p><img src="'+p+'" alt=""><img src="'+e+'" alt=""></p><p>Первый проворкинг PROVODKA в Москве открылся 29 октября в строении №4 <strong>московского завода «Кристалл»</strong>. Инициатором создания проворкинга выступила команда <strong>проекта Про.Движение&gt;</strong>, под руководством Петра Виноградова, известная своими архитектурными фестивалями в городах России и СНГ, Про.Ёлкой в городе Выкса и <a href="/workshop/archive/pro-dvizhenie/">мастерскими проекта Про.Движение, которые размещены в том же здании</a>.</p><p><strong>Проворкинг</strong> <em>[professional, productive working]</em> PROVODKA – это максимально удобное пространство для талантливых и профессиональных людей желающих с нуля реализовать собственные художественные проекты.</p><p><img src="'+a+'" alt=""><img src="'+g+'" alt=""><img src="'+i+'" alt=""></p><p>Сейчас PROVODKA начинает свою работу как <strong>общественный офис на 24 рабочих места</strong>. Резиденты могут пользоваться <strong>кухней</strong>, <strong>принт-центром</strong> с возможностью печати до А0, <strong>экраном и проектором</strong> для презентации своих проектов, <strong>переговорной зоной</strong> с красивым столом ручной работы на 10-12 мест, <strong>услугами</strong> там же расположенных конструкторского бюро Bulwark, архитектурной мастерской «Проектная группа А2» и нескольких <strong>дерево- и металлообрабатывающих художественных мастерских</strong>.</p><blockquote><p><em>«Здесь пространство людей, которые делают честные вещи. Наша концепция – зарабатывать не на людях, а вместе с ними, не на пространстве, а с помощью пространства.» Петр Виноградов</em></p></blockquote><p>В планах организаторов площадки запуск образовательных программ <strong>по проектированию</strong>, художественной <strong>металлообработке</strong>, истории русского искусства и созданию <strong>кинетических скульптур</strong>.</p><p><img src="'+c+'" alt=""></p>',8)]))}const h=r(d,[["render",l]]);export{P as __pageData,h as default};
